def create_taclebench_boxplot():
    """创建TacleBench任务集箱线图对比"""
    cfs_data, yat_data = generate_taclebench_data()
    
    # 创建图表
    fig, ax = plt.subplots(figsize=(16, 10))
    
    # 准备数据
    all_data = []
    labels = []
    colors = []
    positions = []
    
    pos = 1
    for task in task_names:
        # CFS数据
        all_data.append(cfs_data[task])
        labels.append(f'{task}\n(CFS)')
        colors.append('lightcoral')
        positions.append(pos)
        
        # YAT数据
        all_data.append(yat_data[task])
        labels.append(f'{task}\n(YAT)')
        colors.append('lightblue')
        positions.append(pos + 0.5)
        
        pos += 1.5
    
    # 创建箱线图
    bp = ax.boxplot(all_data, positions=positions, widths=0.4, patch_artist=True,
                    showfliers=True, notch=True)
    
    # 设置颜色
    for i, (patch, color) in enumerate(zip(bp['boxes'], colors)):
        patch.set_facecolor(color)
        patch.set_alpha(0.7)
        patch.set_edgecolor('black')
        patch.set_linewidth(1)
    
    # 设置其他元素的样式
    for element in ['whiskers', 'fliers', 'medians', 'caps']:
        plt.setp(bp[element], color='black', linewidth=1)
    
    # 设置中位数线为红色加粗
    plt.setp(bp['medians'], color='darkred', linewidth=2)
    
    # 修复X轴标签设置
    tick_positions = [1 + i * 1.5 + 0.25 for i in range(len(task_names))]
    ax.set_xticks(tick_positions)
    ax.set_xticklabels(task_names, rotation=45, ha='right')
    
    # 设置标题和标签
    ax.set_title('TacleBench任务集执行时间分布对比\n(CFS vs YAT-CASched)', 
                fontsize=16, fontweight='bold', pad=20)
    ax.set_ylabel('执行时间 (ms)', fontsize=12)
    ax.set_xlabel('TacleBench任务', fontsize=12)
    
    # 添加图例
    from matplotlib.patches import Patch
    legend_elements = [
        Patch(facecolor='lightcoral', alpha=0.7, label='CFS调度器'),
        Patch(facecolor='lightblue', alpha=0.7, label='YAT-CASched调度器')
    ]
    ax.legend(handles=legend_elements, loc='upper right', fontsize=11)
    
    # 设置网格
    ax.grid(True, alpha=0.3, axis='y')
    ax.set_axisbelow(True)
    
    # 添加统计信息文本框
    stats_text = generate_statistics_summary(cfs_data, yat_data)
    ax.text(0.02, 0.98, stats_text, transform=ax.transAxes, 
            bbox=dict(boxstyle="round,pad=0.5", facecolor="wheat", alpha=0.8),
            verticalalignment='top', fontsize=10, family='monospace')
    
    plt.tight_layout()
    plt.savefig('img/taclebench_boxplot.pdf', dpi=300, bbox_inches='tight')
    print("TacleBench箱线图已保存为: img/taclebench_boxplot.pdf")
    
    return fig

def generate_statistics_summary(cfs_data, yat_data):
    """生成统计摘要信息"""
    cfs_all = np.concatenate(list(cfs_data.values()))
    yat_all = np.concatenate(list(yat_data.values()))
    
    cfs_median = np.median(cfs_all)
    yat_median = np.median(yat_all)
    cfs_q75_q25 = np.percentile(cfs_all, 75) - np.percentile(cfs_all, 25)
    yat_q75_q25 = np.percentile(yat_all, 75) - np.percentile(yat_all, 25)
    
    median_improvement = ((cfs_median - yat_median) / cfs_median) * 100
    iqr_improvement = ((cfs_q75_q25 - yat_q75_q25) / cfs_q75_q25) * 100
    
    stats_text = f"""统计摘要:
CFS中位数:     {cfs_median:.3f} ms
YAT中位数:     {yat_median:.3f} ms
中位数改善:    {median_improvement:+.1f}%

CFS四分位距:   {cfs_q75_q25:.3f} ms
YAT四分位距:   {yat_q75_q25:.3f} ms
变异性改善:    {iqr_improvement:+.1f}%"""
    
    return stats_text

def create_detailed_comparison_table():
    """创建详细的任务对比表"""
    cfs_data, yat_data = generate_taclebench_data()
    
    print("\n=== TacleBench任务执行时间详细对比 ===")
    print("=" * 80)
    print(f"{'任务名':<15} {'CFS中位数':<12} {'YAT中位数':<12} {'改善':<8} {'CFS IQR':<10} {'YAT IQR':<10}")
    print("=" * 80)
    
    total_cfs_median = 0
    total_yat_median = 0
    
    for task in task_names:
        cfs_median = np.median(cfs_data[task])
        yat_median = np.median(yat_data[task])
        improvement = ((cfs_median - yat_median) / cfs_median) * 100
        
        cfs_iqr = np.percentile(cfs_data[task], 75) - np.percentile(cfs_data[task], 25)
        yat_iqr = np.percentile(yat_data[task], 75) - np.percentile(yat_data[task], 25)
        
        total_cfs_median += cfs_median
        total_yat_median += yat_median
        
        print(f"{task:<15} {cfs_median:<12.3f} {yat_median:<12.3f} {improvement:<+7.1f}% {cfs_iqr:<10.3f} {yat_iqr:<10.3f}")
    
    print("=" * 80)
    overall_improvement = ((total_cfs_median - total_yat_median) / total_cfs_median) * 100
    print(f"{'总体平均':<15} {total_cfs_median/12:<12.3f} {total_yat_median/12:<12.3f} {overall_improvement:<+7.1f}%")
    print("=" * 80)

def create_performance_distribution():
    """创建性能分布直方图"""
    cfs_data, yat_data = generate_taclebench_data()
    
    fig, (ax1, ax2) = plt.subplots(1, 2, figsize=(14, 6))
    
    # 合并所有任务的数据
    cfs_all = np.concatenate(list(cfs_data.values()))
    yat_all = np.concatenate(list(yat_data.values()))
    
    # 绘制分布直方图
    bins = np.linspace(0, max(np.max(cfs_all), np.max(yat_all)), 30)
    
    ax1.hist(cfs_all, bins=bins, alpha=0.7, color='lightcoral', 
             label='CFS', density=True, edgecolor='black')
    ax1.hist(yat_all, bins=bins, alpha=0.7, color='lightblue', 
             label='YAT-CASched', density=True, edgecolor='black')
    
    ax1.axvline(np.mean(cfs_all), color='red', linestyle='--', linewidth=2,
                label=f'CFS均值: {np.mean(cfs_all):.3f}ms')
    ax1.axvline(np.mean(yat_all), color='blue', linestyle='--', linewidth=2,
                label=f'YAT均值: {np.mean(yat_all):.3f}ms')
    
    ax1.set_xlabel('执行时间 (ms)')
    ax1.set_ylabel('概率密度')
    ax1.set_title('总体执行时间分布对比')
    ax1.legend()
    ax1.grid(True, alpha=0.3)
    
    # 绘制累积分布函数
    cfs_sorted = np.sort(cfs_all)
    yat_sorted = np.sort(yat_all)
    
    ax2.plot(cfs_sorted, np.linspace(0, 1, len(cfs_sorted)), 
             color='red', linewidth=2, label='CFS')
    ax2.plot(yat_sorted, np.linspace(0, 1, len(yat_sorted)), 
             color='blue', linewidth=2, label='YAT-CASched')
    
    ax2.set_xlabel('执行时间 (ms)')
    ax2.set_ylabel('累积概率')
    ax2.set_title('累积分布函数对比')
    ax2.legend()
    ax2.grid(True, alpha=0.3)
    
    plt.tight_layout()
    plt.savefig('img/taclebench_distribution.pdf', dpi=300, bbox_inches='tight')
    print("TacleBench分布图已保存为: img/taclebench_distribution.pdf")
    
    return fig

def main():
    """主函数"""
    print("正在生成TacleBench任务集性能对比图表...")
    
    # 创建输出目录
    import os
    os.makedirs('img', exist_ok=True)
    
    # 生成箱线图
    fig1 = create_taclebench_boxplot()
    
    # 生成分布图
    fig2 = create_performance_distribution()
    
    # 生成详细对比表
    create_detailed_comparison_table()
    
    print("\n图表生成完成!")
    print("- img/taclebench_boxplot.pdf: TacleBench任务集箱线图对比")
    print("- img/taclebench_distribution.pdf: TacleBench执行时间分布对比")
    
    # 显示图表
    plt.show()

if __name__ == "__main__":
    main()